    .marker {
      motion-path: var(--off-set-path);
      offset-path: var(--off-set-path);
      animation: var(--move-animation);
    }

    @keyframes move {
      100% {
        motion-offset: 50%;
        offset-distance: 50%;
      }
    }

    @keyframes secondary {

      /* first circle */
      0% {
        opacity: 1;
        transform: scale(1);
      }

      0.8% {
        opacity: 1;
        transform: scale(1);
      }

      1.3% {
        opacity: 0;
        transform: scale(.4);
      }

      3% {
        opacity: 0;
        transform: scale(.4);
      }

      5% {
        opacity: 1;
        transform: scale(1);
      }

      /* second circle */
