        transform: scale(1);
      }

      36% {
        opacity: 0;
        transform: scale(.4);
      }

      40% {
        opacity: 0;
        transform: scale(.4);
      }

      41.1% {
        opacity: 1;
        transform: scale(1);
      }

      /* 5th circle */
