        opacity: 0;
        transform: scale(.4);
      }

      45.53% {
        opacity: 0;
        transform: scale(.4);
      }

      46% {
        opacity: 1;
        transform: scale(1);
      }

      /* last step */
      89% {
        opacity: 1;
        transform: scale(1);
      }

      89.7% {
        opacity: 0;
        transform: scale(.4);
      }

      96.93% {
